import "./Expense.css";

function Expense() {
  const expense = [
    {
      id: "1",
      title: "Car Insurance",
      date: new Date(2022, 2, 14),
      amount: 234.54,
    },
    {
      id: "2",
      title: "Toilet Paper",
      date: new Date(2022, 3, 19),
      amount: 453.45,
    },
    {
      id: "3",
      title: "Car Washer",
      amount: 5625.6,
      date: new Date(2022, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expense[0].title}
        date={expense[0].date}
        amount={expense[0].amount}
      />

      <ExpenseItem
        title={expense[1].title}
        date={expense[1].date}
        amount={expense[1].amount}
      />
      <ExpenseItem
        title={expense[2].title}
        date={expense[2].date}
        amount={expense[2].amount}
      />
    </div>
  );
}
export default Expense;
